import { focusedStyle, acceptStyle, rejectStyle, FormContainer, baseStyle } from "./style";
import React, { useMemo } from 'react';
import { useDropzone } from 'react-dropzone'
import Logo from "../assets/Logotipo_do_Supremo_Tribunal_Federal.svg";

function Pages() {
    const {
        getRootProps,
        getInputProps,
        isFocused,
        isDragAccept,
        isDragReject
    } = useDropzone({
        accept: {
            "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet"
                : ['.xlsx']
        },
        onDrop: (acceptedFiles) => {
            if (acceptedFiles.length > 0) {
                console.log('test')
            }
        }
    });

    const style = useMemo(() => ({
        ...baseStyle,
        ...(isFocused ? focusedStyle : {}),
        ...(isDragAccept ? acceptStyle : {}),
        ...(isDragReject ? rejectStyle : {})
    }), [
        isFocused,
        isDragAccept,
        isDragReject
    ]);

    const handleSubmit = async (event) => {
        event.preventDefault()
        if (handleValidation()) {
            const { password, username } = values;
            const { data } = await axios.post(loginRoute, {
                username,
                password
            });
            if (data.status === false)
                toast.error(data.msg, toastOptions)
            if (data.status === true) {
                localStorage.setItem('chat-app-current-user', JSON.stringify(data.user))
                navigate("/");
            }
        }
    }


    return (
        <div>
            <FormContainer>
                <form onSubmit={(event) => handleSubmit(event)}>
                    <div className="brand">
                        <img src={Logo} alt="Logo" />
                    </div>
                    <button>Baixar Último Excel</button>
                    <div {...getRootProps({ style })}>
                        <input {...getInputProps()} />
                        <p>Arraste algum arquivo aqui, ou clique para selecionar arquivo</p>
                    </div>
                </form>
            </FormContainer>
        </div >
    );
}

export default Pages;
